// Home.js
import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div>
      <h2>Welcome to the Sports Association Management</h2>
      <nav>
        <ul>
          <li><Link to="/create-member">Create Member</Link></li>
          <li><Link to="/create-event">Create Event</Link></li>
        </ul>
      </nav>
    </div>
  );
}

export default Home;
